import React, { useState, useEffect } from "react";
import { AppData } from "./appdata";
import Doodle from "./doodle";
import helpers from "./helpers";

const Doodles = props => {
  let { state, dispatch } = React.useContext(AppData);
  const doodles = state.resume.doodles.items;
  //console.log(doodles);

  return (
    <React.Fragment>
      <section className="res-doodles res-editable" id="Doodles">
        <h2 className="note rr poly-wrap">Doodles</h2>
        <ul className="skewer">
          {doodles.map((doodle, index) => {
            return <Doodle key={index} id={index} doodle={doodle} />;
          })}
        </ul>
      </section>
    </React.Fragment>
  );
};
export default Doodles;
